	(39, 'dtspl2020@gmail.com', 69, 'asfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjj', 'asfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjj', 'https://digitalduniya.com/', 'https://digitalduniya.com/', NULL, NULL, 'asfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjj', 'https://digitalduniya.com/', NULL, NULL, 'yes', '231566sfg', '2023-11-14', 'India', 'yes', NULL, NULL, 'https://digitalduniya.com/', NULL, 'yes', NULL, 'asfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjjasfagsddsgfdgjdfhkfjhlkdgfhhdfjhfgjj', 'file_6541c1802a8f2.pdf'),
	(40, 'adarshec.pandey8@gmail.com', 72, 'The problem of detecting, recognizing, and tracking people from a drone has become of paramount importance in many video surveillance applications.\r\nOne of the first works that investigated the issues and the challenges of performing face recognition with drone-captured images was  The work in introduced the case of UAV-based crowd surveillance applying facial recognition tools. To perform face recognition, the simple Local Binary Pattern Histogram method from the Open Source Computer Vision (OpenCV) was used. In [7], Hsu et al. investigate how altitudes, distances, and angles of depression influence the performance of face detection and recognition by drones. In the same article, the authors present a dataset for the evaluation of facial recognition algorithms from drone images, called DroneFace.', 'a system able to track a specific person in the case of multi-person interference. Such a system automatically takes a photo of the target’s frontal face, without the use of facial recognition. After boxing out the target on the image received by the ground station, the drone (a Parrot Bebop2) flies around the target person, mounting onboard an RGB camera, which automatically keeps shooting in the horizontal direction with a resolution of 640 × 480 pixels. In their experiment, the authors of set the flying height at about 2 m, while the distance between the target person and the drone ranged from 4 to 5 m. Such conditions are very different from ours, as will be explained in the following.\r\nIn , the authors used a camera mounted on board of a drone while the algorithms for face recognition running on a computer on the ground. After scanning the faces and comparing them to the provided database, the output obtained has the individual’s face highlighted in a square with a color-coding sequence (white, green, or red). However, no information about the height of the drone is given, neither about the weather conditions. Moreover, no detail is given on the algorithm used for facial recognition.', 'https://www.researchgate.net/publication/347805828_Applications_and_Challenges_in_Video_Surveillance_via_Drone_A_Brief_Survey/link/601a48e0299bf1cc269ce4ac/download', 'https://www.eucnc.eu/wp-content/uploads/2020/07/2020-05-29-6G.-Why-Nicolas-Demassieux-EUCNC-VDEF.pdf', NULL, NULL, 'Intelligent cameras have recently seen a large diffusion and represent a low-cost solution for improving public security in many scenarios. Moreover, they are light enough to be lifted by a drone. The use of drones equipped with intelligent cameras for face/object recognition has already been reported in the literature. However, this is the first time that such a solution is tested in a 5G environment. The experiments have shown the validity of the approach despite the very harsh conditions in which our drone operated, due to the strong winds blowing at a height of 40 m from the ground. We flew at 40 m because with the camera used in our setup we saw that with a height of more than 50 m the bounding boxes of the detected faces are too small for having a good face recognition.\r\nIn our applications, the visual information recorded by the camera (photo and video) is first transmitted to the ground by using the 5G wireless network and then is processed by using Artificial Intelligence technologies based on deep learning. We point out that recognizing in real-time a face of a person or a specific object in motion, is now within the reach of a home computer, thanks to the processing power of graphics cards equipped with the most recent Graphics Processing Units.The process of detecting a person’s identity through his/her face is often referred to as facial recognition. Typically, facial recognition in images is performed through two distinct phases. In the first phase, usually referred to as face detection, the system detects a face appearing within an image. Specifically, when an original image is processed, a set of new images is produced as a result. Each of these contains the face of a person appearing in the original image. The second phase is devoted to the recognition of the identities of the people to whom the identified faced belong. This is usually the most complex procedure and requires both a database, with which the faces detected have to be compared, and an algorithm for the face comparison. In the literature, this process is often referred to as face verification and has been the subject of great developments in recent years thanks to deep learning technologies. Although facial recognition has been intensively studied for many years, only recently it was applied to images recorded by drones. Indeed, the interest in computer vision applications applied to images taken by drones is constantly growing, due to their low-cost and the enormous technological progress they have had in recent years.', '', NULL, NULL, 'no', '', '0000-00-00', '', 'no', NULL, NULL, '', NULL, 'no', NULL, 'Undergoing 6G designs will involve not only ground network deployments, but integrated architectures interconnecting space, air, ground and sea, providing 3D coverage involving space, time, and frequency domains, which will be exploited in all transport means [21]. Advances such as tactile communications, quantum computing, Distributed Ledger Technology (DLT), THz communications, Machine Learning (ML)-based network resiliency and slicing, multiple radio access technologies, intelligent reflecting surfaces, or the integration of cloud–edge–fog, will be part of the future V2X ecosystem [22]. V2X involves communications among vehicles (V2V), with infrastructure elements (V2I), with remote entities (e.g., cloud servers), and even with pedestrian (Vehicle-to-Pedestrian — V2P). This way, current use cases identified for Cellular V2X (C-V2X) in [23], i.e., remote driving, advanced driving, vehicle platooning, extended sensors, and vehicle QoS support, will be extended to enable more advanced features for each of these groups as well as other revolutionary applications exploiting expected 6G performances. The list of potential V2X services to be developed thanks to 6G advances is continuously increasing [21], [24], [25]. Evolutionary 6G applications considering already in-mind services using 5G are depicted in Fig. 1 and include:\r\n\r\n    •\r\n\r\n    Autonomous driving up to level 5. According to SAE taxonomy [26], this involves autonomous driving with no human intervention. Especial emphasis will be put on last-mile (domestic) transportation.\r\n\r\n    Current status: Integration of 5G communications and involved technologies for enabling cooperative perception is a reality in autonomous vehicles, as recent studies indicate [27], [28]. Although mass-market deployment is pending, the potential of base 5G-NR has been tested on real roads within the frame of different research projects [29]. These works indicate that communications will be essential to complement data coming from on-board sensors, such as cameras or laser and ultrasound radars.\r\n    •\r\n\r\n    Enhanced navigation. Thanks to improvements expected in the radio access level and drone/satellite support, positioning of sub-meter accuracy is expected, as well as extra bandwidth and network availability to receive digital maps and real-time traffic information.\r\n\r\n    Current status: The role of accurate 5G positioning is clear in the literature [30]. Improved capabilities, as compared to regular GPS, can enhance perception, decision making and control in the vehicular domain. Recent studies indicate real performances at the centimetre level [31], enabling real identification of vehicle paths within the road lane, for instance.\r\n    •\r\n\r\n    Environmental perception. Ubiquitous network access will help vehicles exchange perception data detected by themselves and by especial hardware such as drones or static high-resolution equipment forming part of the vehicular fixed infrastructure.\r\n\r\n    Current status: The work in [32] shows a clear example on how 5G connectivity support data exchange to create a collaborative map to support navigation. In [33], the authors propose using 5G advances to speed-up an ML-based perception scheme by assuring efficient message passing. A more common scenario is exploited in [34] for enabling autonomous management of a road intersection, in this case enhanced by communications in the millimetre-wave bands of 5G.\r\n    •\r\n\r\n    In-vehicle entertainment. Enhanced Ultra Mobile Broadband (eUMBB) and massive connectivity will enable true bidirectional 4 K/8K multimedia streams as well as truly immersing applications leveraging the advances brought by the tactile Internet and five-sense communications.\r\n\r\n    Current status: User experience will improve greatly with the integration of more efficient communications, as it is the case of the car cockpit, offering more accurate views of maps, instantaneous user assistance or access to multimedia content [35]. Live video is a common use case for evaluating data rate, given high throughput demands, but 5G technologies such as radio improvements and MEC have demonstrated to support multimedia streams efficiently under real settings [36].\r\n    •\r\n\r\n    Extended emergency services. Aiming at further extending safe driving, Massive Ultra-Reliable and Low Latency communications (mURLL) and ultra massive Machine Type Communications (umMTC) will be supported by Visible Light Communications (VLC) and other transmission technologies, including solutions currently devoted to Internet of Things (IoT) scenarios, e.g., Low Power Wide Area Network (LPWAN). Furthermore, DLT-based solutions and quantum security will assure cybersecurity in the long term.\r\n\r\n    Current status: The integration of QoS assurance mechanisms in 5G has been exploited, for instance, to guarantee network access at emergency situations, as explained in [37]. The regular eCall services will be also subject to improvements with 5G, as proposed in [38], with a smart-phone-based accident notification service that can work at particular locations with ad-hoc network infrastructures such as tunnels.\r\n    •\r\n\r\n    Connectivity of personal mobility vehicles. A reduction in the energy impact per bit transmitted will enable the connection of personal vehicles such as bikes or scooters using 3GPP technologies, which traditionally involve higher power consumption than LPWAN counterparts.\r\n\r\n    Current status: Given the popularity of eco-efficient personal vehicles, their integration within the C-ITS ecosystem is attracting great attention from the research community. Current efforts focus on the development of efficient and light OBUs [39] that could provide extra services to riders [40]. To this end, there are key enabling technologies from both communication and computation perspectives. Considering the former, as mentioned previously, current LPWAN solutions, e.g., LoRaWAN, Sigfox, NB-IoT, etc., are considered as the most suitable alternatives given their long transmission distances and limited energy consumption. However, the arrival of efficient 6G transmission schemes will allow the connectivity of IoT devices in a long-term basis [41]. Regarding on-board computation, algorithms based on the TinyML paradigm can provide intelligent data-processing and decision-making with low computational overhead [42]. Other proposals adopt paradigms such as fog computing [43], computation offloading [44], or Federated Learning (FL) [45] to distribute computing-intensive tasks and alleviate energy consumption.\r\n    •\r\n\r\n    Green traffic management. Massive equipment of connected devices will improve On-Board Unit (OBU) penetration rates, making real-time traffic management a reality and embracing scenarios such as efficient platooning, adaptive traffic lights, pollution control, on-demand green and speedy routes or emergency tracks.\r\n\r\n    Current status: Advances in platooning are a good example of exploiting 5G PC5 capabilities. In [46], the authors study this potential to create high-density platoons, taking advantage of 5G for positioning, low-latency communications and reliable connections to save fuel and reduce pollution. Emergency warning and collision avoidance services are implemented in [47], by using V2I and PC5 communications, showing the flexibility of 5G when different communication patterns are needed.\r\n\r\nMoreover, the arrival of 6G will enable other disruptive services, thanks to radical improvements in networking and processing performance, technology penetration and consequent electronic advances. Some of these applications will be:', ''),
